import { useEffect, useState } from "react";

export default function MapPoly(props){
    const [dataJson,setDataJson] = useState();

    useEffect(()=>{
        var data = require('json!./json/world_'+props.finalNumber+'.geojson')
        setDataJson(data);

    })
}
